import React, { useState, useEffect } from "react"
import { useNavigate } from "react-router-dom";

const DetalleSucursal = (props) => {
    const navigate = useNavigate();
    const [Sucursal, setSucursal] = useState({
        ID_Sucursal: 0,
        Nombre_Sucursal: '',
        Telefono: 0,
        Descripcion: '',
        Estado: true
    })

    const CambioValor = (e) => {
        const { name, value } = e.target
        setSucursal({ ...Sucursal, [name]: value })
    }

    const ClickBtnGuardar = () => {

    }

    const cargandoFormulario = async () => {
        if (props.IdPasajeroActual > 0) {
            let URL = `http://localhost:${props.ApiPort}/api/ApiSucursal/ConsultaSucursalxID?ID_Sucursal=${props.IdPasajeroActual}`
            let Sucursales = await fetch(URL).then(async response => {
                if (!response.ok) {
                    console.log("No Ok")
                    throw new Error(response.statusText)
                }
                return await response.json()
            }).catch(error => {
                console.log(error)
            })
            if (Sucursales.Codigo >= 0) {
                setSucursal(Sucursales.Contenido[0])
            }
            else {
                console.log(Sucursales.Mensaje)
            }
        }
    }

    useEffect(() => {
        cargandoFormulario();
        //eslint-disable-next-line
    }, [])

    return <>
        <div style={{ backgroundColor: '#d4d4d4', padding: '20px' }}>
            <header style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '55px', backgroundColor: '#6f9954' }}>
                <h3 style={{ margin: 0, textAlign: 'center', color: "white" }}>Sucursales</h3>
            </header>
            <div className="container mt-3">
                <div className="row mb-3">
                    <div className="col-12 col-md-3 text-md-right d-flex align-items-center justify-content-md-end">
                        <label className="form-label mb-0">Nombre de Sucursal</label>
                    </div>
                    <div className="col-12 col-md-4">
                        <input type="text" className="form-control" name="Nombre_Sucursal" id="Nombre_Sucursal" value={Sucursal.Nombre_Sucursal} onChange={CambioValor} />
                    </div>
                </div>
                <div className="row mb-3">
                    <div className="col-12 col-md-3 text-md-right d-flex align-items-center justify-content-md-end">
                        <label className="form-label mb-0">Teléfono</label>
                    </div>
                    <div className="col-12 col-md-4">
                        <input type="text" className="form-control" name="Telefono" id="Telefono" value={Sucursal.Telefono} onChange={CambioValor} />
                    </div>
                </div>
                <div className="row mb-3">
                    <div className="col-12 col-md-3 text-md-right d-flex align-items-center justify-content-md-end">
                        <label className="form-label mb-0">Pais</label>
                    </div>
                    <div className="col-12 col-md-4">
                        <select className="form-select" name="Paises" id="Paises" onChange={props.teclaPresionada}>
                            {ListaPais.map((item, i) => (
                                <option key={i} value={item.ID_Pais}>{item.Nombre_Pais}</option>
                            ))}
                        </select>
                    </div>
                </div>
                <div className="row mb-3">
                    <div className="col-12 col-md-3 text-md-right d-flex align-items-center justify-content-md-end">
                        <button className="btn btn-dark w-100" onClick={() => ClickBtnGuardar()}>Guardar</button>
                    </div>
                    <div className="col-12 col-md-2 d-flex justify-content-md-start mt-2 mt-md-0">
                        <button className="btn btn-dark w-100" onClick={() => navigate("/Sucursales/BusquedaSucursales")}>Salir</button>
                    </div>
                </div>
            </div>
        </div>
    </>

}
export default DetalleSucursal;
